import { useState, useEffect } from "react";

const Import = () => {
  const [IMP, setIMP] = useState(null);

  useEffect(() => {
    const { IMP } = window;
    setIMP(IMP);
  }, []);
  let keys;
  if (IMP !== null) {
    // console.log(IMP);
    IMP.init("imp37098043");
    keys = Object.keys(IMP);
  }
  return (
    <>
      {keys.map((v) => {
        return <p>{v}</p>;
      })}
    </>
  );
};

export default Import;
